import Layout from "../components/Layout";

function Apropos() {
  return (
    <div className="Apropos">
      <Layout>
        <h1 className="bg-clip-text text-6xl text-center text-transparent bg-gradient-to-r from-violet-500 to-fuchsia-900">A propos</h1>
      </Layout>
    </div>
    );
}

export default Apropos;
